import React, {useState} from 'react';
import {
  Link,
} from 'react-router-dom';
import Add from './add';
import NotificationsIcon from '@material-ui/icons/Notifications';
import NotificationsNoneIcon from '@material-ui/icons/NotificationsNone';


const BottomNav = ({path, addUserInfo,sentToServer}) => {
  const [alert, setAlert] = useState('NotificationsIcon');

  return (
    <div className="mngr-bottom-nav" dir="rtl">
      <Add path={path} addUserInfo={addUserInfo} sentToServer={sentToServer}/>
      <Link to={"/manager/alert"}>
        <NotificationsIcon
        className="mngr-bottom-nav-alert"
        style={{fontSize:40}}
        />
      </Link>
    </div>
  );
}

export default BottomNav;
